import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="container">
      <div className="question">재혁아 나 사랑해?</div>
      <div className="choice-button">
        <button>응</button>
      </div>
    </div>
  );
}

export default App;
